import React  from 'react';
import {Button, Grid} from 'semantic-ui-react'
import FlipMove from 'react-flip-move';

import './TodoItems.css';


const TodoItems = (props) => {


    // const deleteItem = (something) => {
    //     console.log(something)

    // }

    const createTask = (item , index) => {
    return (<div className="so" key={index}>
        <li>
            {item.taskText}
        </li>
        <Button className="btn-left" color="green" inverted >edit</Button>
        <Button className="btn-left" color="red" inverted  onClick={(e)=>props.delete(e,item._id)} >delete</Button>
    </div>)
    }

return (

        <Grid textAlign="center">
            <ul className="centered">
                <FlipMove duration={250} easing="ease-out">
                    {props.entries && props.entries.map(createTask)}
                </FlipMove>
            </ul>

        </Grid>


    );
}


export default TodoItems;
